export function Logo({}) {
  return <div className="absolute top-[3rem]">
            <div id="logo" className="flex flex-col items-center leading-10 ">
              <img src="/images/NJITBytes.png" width={100}></img>
              <h1>NJITBytes</h1>
              <div>Healthier College Living</div>
            </div>
          </div>;
}
